import React from 'react';
import { Navbar, Nav } from 'react-bootstrap';
import { Link } from 'react-router-dom';

function NavbarComponent() {
    return (
        <Navbar bg="light" expand="lg">
            <Navbar.Brand as={Link} to="/">Health Horizon</Navbar.Brand>
            <Navbar.Toggle aria-controls="basic-navbar-nav" />
            <Navbar.Collapse id="basic-navbar-nav">
                <Nav className="me-auto">
                    <Nav.Link as={Link} to="/marcar-consulta">Marcar Consulta</Nav.Link>
                    <Nav.Link as={Link} to="/ver-exames">Ver Exames</Nav.Link>
                    <Nav.Link as={Link} to="/historico-consultas">Hist√≥rico de Consultas</Nav.Link>
                    <Nav.Link as={Link} to="/perfil">Perfil</Nav.Link>
                </Nav>
            </Navbar.Collapse>
        </Navbar>
    );
}

export default NavbarComponent;
